import playerRank from './PlayerRank.json'

export function getPlayers() {
    const axios = require('axios').default;
    var allPlayers = [];
    var a = [];

    for (var j = 1; j <= 10; j++) {
        a.push(j);
        var fullName = playerRank[j.toString()];
        axios.get('https://www.balldontlie.io/api/v1/players?search=' + fullName)
            .then(function (response) {
                var player = response.data;
                console.log(player.data[0]);
                allPlayers.push(player.data[0].id)
            })
            .catch(function (error) {
                console.log(error);
            })
            .then(function () {
            });
    }
    delay(1000);
    return allPlayers;
}
